        <>
    <Heading bg='#030303' color='#7b7b7b' textAlign='center' mt='50px'>
        Live Matches
    </Heading>

    <Heading bg='#030303' color='#7b7b7b' textAlign='center' mt='50px'>
        Upcoming Matches
    </Heading>
        </>
    )
}

export default MainPage
